import React ,{ Component } from 'react';
import '../../../node_modules/bootstrap/dist/css/bootstrap.min.css';
import {
Container,
} from 'react-bootstrap'
import Row from 'react-bootstrap/Row'
import './UserHome.css'


class PastBids extends Component {
    constructor(props) {
        super(props);
        this.state = {
        data: null,
        };
    }

    componentDidMount() {
        fetch('http://localhost:9000/pastBids')
        .then(response => response.json())
        .then(data => this.setState({ data }));
    }

    render(){
        return (
            <div class = "recentbids">
                <Container>
                    <Row>
                        {this.state.data}
                    </Row>
                    <Row>
                        {this.state.data}
                        Bid 1
                    </Row>
                    <Row>
                        {this.state.data}
                        Bid 2
                    </Row>
                    <Row>
                        {this.state.data}
                        Bid 3
                    </Row>
                    <Row>
                        {this.state.data}
                        Bid 4
                    </Row>
                    <Row>
                        {this.state.data}
                        Bid 5
                    </Row>

                </Container>
            </div>
        );
    }
}

export default PastBids;
